export const apiProductProductCreate = (
  productCreateInput: ProductCreateInput
) => {
  const formData = new FormData();
  formData.append("product_type", productCreateInput.product_type.toString());
  formData.append("title", productCreateInput.title);
  formData.append("main_image", productCreateInput.main_image);
  formData.append("price", productCreateInput.price);
  formData.append("off_price", productCreateInput.off_price);
  formData.append("quantity", productCreateInput.quantity.toString());
  if (productCreateInput.discount_end_time !== undefined) {
    formData.append("discount_end_time", productCreateInput.discount_end_time);
  }
  formData.append("description", productCreateInput.description);
  if (productCreateInput.order_limit !== undefined) {
    formData.append("order_limit", productCreateInput.order_limit.toString());
  }
  if (productCreateInput.device_model !== undefined) {
    formData.append("device_model", productCreateInput.device_model);
  }
  if (productCreateInput.included_products !== undefined) {
    productCreateInput.included_products.forEach((value: any) =>
      formData.append("included_products", value)
    );
  }

  return customInstance<ProuductCreateOutput>({
    url: `/api/product/product/`,
    method: "POST",
    headers: { "Content-Type": "multipart/form-data" },
    data: formData,
  });
};

